INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (325, 24001, 126001, "クリア", 2, 1, 0, 2, 40011, 5, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです");
